events HIV from reproducing in uninfected cells, but it does not help cells that have already been infected with the virus.','en',1,'2008-07-29 17:40:04',1,'2012-08-10 12:05:42','320497be-0370-102d-b0e3-001ec94a0cc1'),(3497,916,'Combination antibiotic therapy.  First-line treatment for pneumocystis carinii pneumonia.','en',1,'2008-07-29 17:40:04',1,NULL,'32049890-0370-102d-b0e3-001ec94a0cc1'),(3498,792,'Combination antiretroviral drug.','en',1,'2008-07-29 17:40:04',1,'2012-08-10 12:05:41','32049976-0370-102d-b0e3-001ec94a0cc1'),(3499,2457,'A basic polypeptide antibiotic (trade name Viocin) administered intramuscularly (along with other drugs) in the treatment of tuberculosis','en',1,'2008-07-29 17:40:04',1,'2012-08-10 12:03:30','32049a3e-0370-102d-b0e3-001ec94a0cc1'),(3500,1406,'Injectable aminoglycoside used in drug-resistant TB treatment. Inhibits protein synthesis through disruption of ribosomal function. (Short name from WHO)','en',1,'2008-07-29 17:40:04',1,'2012-08-10 12:03:08','32049b10-0370-102d-b0e3-001ec94a0cc1'),(3501,1416,'Fluoroquinolone used in drug-resistant TB treatment. (Short name from WHO)','en',1,'2008-07-29 17:40:04',1,'2012-08-10 15:52:29','32049e76-0370-102d-b0e3-001ec94a0cc1'),(3502,1417,'Aminoglycoside used in drug-resistant TB treatment. (Short name from WHO)','en',1,'2008-07-29 17:40:05',1,'2012-08-10 12:03:06','32049f3e-0370-102d-b0e3-001ec94a0cc1'),(3503,1418,'Fluoroquinolone used in drug-resistant TB treatment. (Short name from WHO)','en',1,'2008-07-29 17:40:05',1,'2012-08-10 12:03:10','3204a006-0370-102d-b0e3-001ec94a0cc1'),(3504,1412,'Phenazine derivative used in drug-resistant TB treatment. (Short name from WHO)','en',1,'2008-07-29 17:40:05',1,'2012-08-10 12:03:27','3204a0ce-0370-102d-b0e3-001ec94a0cc1'),(3505,2459,'reinforcement TB med with unclear efficacy.  Clarithromycin is a macrolide antibiotic used to treat pharyngitis, tonsillitis, acute maxillary sinusitis, acute bacterial exacerbation of chronic bronchitis, pneumonia (especi